// export default Navbars;

function Navbars() {
  return (
    <div className="fixed-top">
      <Navbar bg="primary" expand="lg">
        <Container>
          <Navbar.Brand className="text-light fw-bolder" href="#home">
            React-Website
          </Navbar.Brand>
          <Navbar.Toggle
            className="menu bg-light"
            aria-controls="basic-navbar-nav"
          />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="Navbar mx-auto my-4 align-items-start fw-bold">
              <Link className="text-light" to="/">
                Home
              </Link>
              <Link className="text-light" to="/product">
                Product
              </Link>
              <Link className="text-light" to="/blog">
                Blog
              </Link>
              <Link className="text-light" to="/contact">
                Contact
              </Link>
              <Link className="text-light" to="/cart">
                Cart
              </Link>
            </Nav>
            <Form className="form">
              <Form.Group className="mb-3" controlId="formBasicEmail">
                <Form.Control type="text" placeholder="Enter search" />
              </Form.Group>
              <Button
                variant="light text-light border-light bg-primary"
                type="search"
              >
                Search
              </Button>
              <AiOutlineShoppingCart
                style={{ fontSize: "40px" }}
                className="mb-3 ms-2 text-light"
              />
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default Navbars;
